  client.set(schoolName, value, print);
}

const get = promisify(client.get).bind(client);

async function displaySchoolValue(schoolName) {
  const result = await get(schoolName).catch(err => {
    if (err) {
      console.log(err);
      throw (err);
    }
  });
  console.log(result);
}

